function drawChart() {

        compression_chart.draw(compression_data, options_compression);
        

        
}

function modifyData(preK, currK) {
    sigma_values[preK+1][2] = 'null';
    sigma_values[currK+1][2] = 'point { size: 18; shape-type: star; fill-color: #a52714; }';
//     console.log(currK);
}

function modifyPSNR(preK, currK) {
    psnr_values[preK+1][2] = 'null';
    psnr_values[currK+1][2] = 'point { size: 18; shape-type: star; fill-color: #a52714; }';
}

function modifyCR(preK, currK) {
    compression_ratio_values[preK+1][2] = 'null';
    compression_ratio_values[currK+1][2] = 'point { size: 18; shape-type: star; fill-color: #a52714; }';
}



var preK = 0;

function init() {
	console.log( "ready!" );

    google.charts.load('current', {'packages':['corechart']});
    google.charts.setOnLoadCallback(drawChart);
    
    
 	$("#norm").text(norm_sigma_psnr[0][1]);
	$("#sigmak").text(sigma_values[1][1]);
	$("#sigmak1").text(norm_sigma_psnr[0][2]);
	$("#psnr").text(norm_sigma_psnr[0][3]);
	$("#cr").text(compression_ratio_values[1][1]);
	$("#cp").text(norm_sigma_psnr[0][4]);

    	
	// With JQuery
	$("#ex6").slider();
		$("#ex6").on("slide", function(slideEvt) {
		
		    if (slideEvt.value <= 685) {
				$("#ex6SliderVal").text(slideEvt.value);
				$("#k").text(slideEvt.value);
// 				console.log("idx now: " + slideEvt.value);	
// 				console.log("data now: " + norm_data[slideEvt.value]);	

				$("#norm").text(norm_sigma_psnr[slideEvt.value-1][1]);
				$("#sigmak").text(sigma_values[slideEvt.value][1]);
				$("#sigmak1").text(norm_sigma_psnr[slideEvt.value-1][2]);
				$("#psnr").text(norm_sigma_psnr[slideEvt.value-1][3]);
				$("#cr").text(compression_ratio_values[slideEvt.value][1]);
				$("#cp").text(Number.parseFloat(norm_sigma_psnr[slideEvt.value-1][4]).toFixed(4));
				
				$("#my_image").attr("src","images/queen/queen_" + (slideEvt.value-1) + ".png");
			
				modifyData(preK, slideEvt.value-1);
				data = google.visualization.arrayToDataTable(sigma_values);
				chart.draw(data, options_sigma);
			
				modifyPSNR(preK, slideEvt.value-1);
				psnr_data = google.visualization.arrayToDataTable(psnr_values);
				psnr_chart.draw(psnr_data, options_psnr);

				modifyCR(preK, slideEvt.value-1);
		        compression_data = google.visualization.arrayToDataTable(compression_ratio_values);
				compression_chart.draw(compression_data, options_compression);

				preK = slideEvt.value-1;
		    }
		});
	}
